import LoginViews from './views/LoginViews'
import App from './App'
import { createRouter,createWebHistory } from 'vue-router'

const routes = [
    {
        path: '/login',
        component:LoginViews
    },
    {
        path: '/',
        component:App
    }
];
const router = createRouter({
    routes:routes,
    //mode:'hash|history'
    history:createWebHistory()
});
export default router
